import { Link } from 'react-router-dom';

const Nav = () => {
  return (
    <div>
    <header className="App__header">
      <span className="App__logo-text">ANIME QUOTES</span>
    </header>
    <div class="navbar">
      <Link to="/">
      Home
      </Link>
      <Link to="/search" class="navbar__link">
      Search
      </Link>
      <Link to="/favourite-list">
      Favourite
      </Link>
    </div>
    </div>
  );
};

export default Nav;
